import { useEffect, useState } from "react";
import API from "../api";
import { Link } from "react-router-dom";

function Dashboard() {
  const [doctors, setDoctors] = useState([]);
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
    fetchDoctors();
    fetchAppointments();
  }, []);

  const fetchDoctors = async () => {
    try {
      const res = await API.get("/doctors");
      setDoctors(res.data);
    } catch (err) {
      console.log("Error fetching doctors:", err);
    }
  };

  const fetchAppointments = async () => {
    try {
      const res = await API.get("/appointments");
      setAppointments(res.data);
    } catch (err) {
      console.log("Error fetching appointments:", err);
    }
  };

  return (
    <div style={styles.dashboardWrapper}>
      <header style={styles.headerSection}>
        <h2 style={styles.mainTitle}>Medical Dashboard</h2>
        <p style={styles.subtitle}>Manage your health and schedule new consultations.</p>
      </header>

      {/* SECTION: DOCTOR LIST */}
      <section style={styles.section}>
        <h3 style={styles.sectionTitle}>Available Specialists</h3>
        <div style={styles.cardContainer}>
          {doctors.map((doc) => (
            <div key={doc.id} style={styles.doctorCard}>
              <div style={styles.avatarPlaceholder}>{doc.name.charAt(0)}</div>
              <h4 style={styles.docName}>{doc.name}</h4>
              <span style={styles.specialtyBadge}>{doc.specialty}</span>
              <p style={styles.locationText}>üìç {doc.location}</p>

              <Link to={`/book/${doc.id}`} style={{ textDecoration: 'none' }}>
                <button style={styles.bookBtn}>Schedule Visit</button>
              </Link>
            </div>
          ))}
        </div>
      </section>

      <div style={styles.divider}></div>

      {/* SECTION: APPOINTMENTS */}
      <section style={styles.section}>
        <h3 style={styles.sectionTitle}>Upcoming Appointments</h3>
        {appointments.length === 0 ? (
          <div style={styles.emptyState}>
            <p>You have no scheduled appointments at this time.</p>
          </div>
        ) : (
          <div style={styles.appointmentList}>
            {appointments.map((a, index) => (
              <div key={index} style={styles.appointmentRow}>
                <div style={styles.appointmentInfo}>
                  <div style={styles.appDocName}>{a.doctor_name}</div>
                  <div style={styles.appSpecialty}>{a.specialty}</div>
                </div>
                <div style={styles.appointmentDetails}>
                  <div style={styles.dateLabel}>DATE</div>
                  <div style={styles.dateValue}>{a.date}</div>
                </div>
                <div style={styles.statusSection}>
                  <span style={styles.statusBadge(a.status)}>{a.status}</span>
                </div>
              </div>
            ))}
          </div>
        )}
      </section>
    </div>
  );
}

const styles = {
  dashboardWrapper: {
    padding: "40px 60px",
    backgroundColor: "#fcfdfe",
    minHeight: "100vh",
    fontFamily: "'Segoe UI', Roboto, sans-serif",
  },
  headerSection: {
    marginBottom: "40px",
  },
  mainTitle: {
    fontSize: "28px",
    color: "#2c3e50",
    margin: 0,
  },
  subtitle: {
    color: "#7f8c8d",
    fontSize: "16px",
    marginTop: "5px",
  },
  section: {
    marginBottom: "50px",
  },
  sectionTitle: {
    fontSize: "18px",
    fontWeight: "700",
    color: "#34495e",
    marginBottom: "20px",
    textTransform: "uppercase",
    letterSpacing: "1px",
  },
  cardContainer: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(280px, 1fr))",
    gap: "25px",
  },
  doctorCard: {
    backgroundColor: "white",
    padding: "30px 20px",
    borderRadius: "16px",
    textAlign: "center",
    border: "1px solid #edf2f7",
    boxShadow: "0 4px 6px rgba(0,0,0,0.02)",
    transition: "transform 0.2s ease",
  },
  avatarPlaceholder: {
    width: "60px",
    height: "60px",
    backgroundColor: "#e3f2fd",
    color: "#007bff",
    borderRadius: "50%",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "24px",
    fontWeight: "bold",
    margin: "0 auto 15px",
  },
  docName: {
    margin: "0 0 5px 0",
    color: "#2c3e50",
    fontSize: "18px",
  },
  specialtyBadge: {
    display: "inline-block",
    backgroundColor: "#f0f4f8",
    color: "#546e7a",
    padding: "4px 12px",
    borderRadius: "20px",
    fontSize: "12px",
    fontWeight: "600",
    marginBottom: "10px",
  },
  locationText: {
    fontSize: "14px",
    color: "#95a5a6",
    margin: "0 0 20px 0",
  },
  bookBtn: {
    width: "100%",
    padding: "10px",
    backgroundColor: "#007bff",
    color: "white",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
    fontWeight: "600",
    fontSize: "14px",
  },
  divider: {
    height: "1px",
    backgroundColor: "#edf2f7",
    margin: "40px 0",
  },
  appointmentList: {
    display: "flex",
    flexDirection: "column",
    gap: "15px",
  },
  appointmentRow: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "20px",
    backgroundColor: "white",
    borderRadius: "12px",
    border: "1px solid #edf2f7",
  },
  appDocName: {
    fontWeight: "600",
    color: "#2c3e50",
    fontSize: "16px",
  },
  appSpecialty: {
    fontSize: "13px",
    color: "#7f8c8d",
  },
  dateLabel: {
    fontSize: "10px",
    color: "#bdc3c7",
    fontWeight: "800",
  },
  dateValue: {
    fontSize: "14px",
    color: "#2c3e50",
    fontWeight: "600",
  },
  statusBadge: (status) => ({
    padding: "6px 14px",
    borderRadius: "50px",
    fontSize: "12px",
    fontWeight: "700",
    textTransform: "capitalize",
    backgroundColor: status === "confirmed" ? "#e6fffa" : "#fff5f5",
    color: status === "confirmed" ? "#38b2ac" : "#e53e3e",
  }),
  emptyState: {
    padding: "40px",
    textAlign: "center",
    backgroundColor: "#f8fafc",
    borderRadius: "12px",
    border: "2px dashed #e2e8f0",
    color: "#94a3b8",
  }
};

export default Dashboard;
